    false,nt"url": null,nt"notes": "This narrative report for Rice Lake NWR
    outlines Refuge accomplishments from September through December of 1953. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include haying, fur harvesting,
    and timber removal. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and hunting. Items of interest, N-R
    forms, and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
